INSERT INTO `uraian` (`id_uraian`, `judul`, `uraian_singkat`, `uraian_lengkap`, `photo`) VALUES
(1, 'Data Geografis', 'Secara Geografis, Kecamatan Tinanggea terletak antara 04<sup>0</sup>46<sup>l</sup>44.1<sup>ll</sup> Lintang Selatan dan 122<sup>0</sup>19<sup>l</sup>73.1<sup>ll</sup> Bujur Timur.', 'Secara Geografis, Kecamatan Tinanggea terletak antara 04<sup>0</sup>46<sup>I</sup>44.1<sup>II</sup> Lintang Selatan dan 122<sup>0</sup>19<sup>I</sup>73.1<sup>II</sup> Bujur Timur.\r\n<br>\r\nKecamatan Tinanggea terdiri dari 22 desa, 2 Kelurahan dan 1 desa persiapan. Dapat dilihat bahwa, Desa Tatangge memiliki wilayah terluas yakni 91,24 km<sup>2</sup>, sedangkan Desa Torokeku memiliki wilayah terkecil yang hanya seluas 2,15 km<sup>2</sup>.\r\n', 'geografis.jpg'),
(2, 'Data Kependudukan', 'Jumlah penduduk di Kecamatan Tinanggea berjumlah 24.168, yang terdiri dari 11.881 penduduk perempuan dan 12.287 penduduk laki- laki. ', 'Jumlah penduduk di Kecamatan Tinanggea berjumlah 24.168, yang terdiri dari 11.881 penduduk perempuan dan 12.287 penduduk laki- laki. Jumlah ini mengalami peningkatan dibandingkan tahun sebelumnya yang berjumlah 23.797 jiwa.\r\n<br> Tingkat pertumbuhan penduduk Kecamatan Tinanggea pada tahun 2016 sebesar 1,01 %, lebih rendah dibanding pertumbuhan penduduk tahun 2015 yaitu sebesar 1,02 %. Kepadatan  penduduk  Kecamatan Tinanggea mengalami peningkatan dari 68,13  jiwa  perkilometer  persegi  tahun 2016 menjadi 57 jiwa per kilometer persegi pada tahun 2016. Wundumbolo merupakan desa dengan tingkat kepadatan penduduk terendah sedangkan Tinanggea adalah desa terpadat penduduknya. <br>', 'logo_konsel.jpg'),
(3, 'Wilayah Kecamatan', 'Letak kawasan Kecamatan Tinanggea memiliki batas-batas wilayah yaitu: Kabupaten Bombana, Kec. Andoolo, Kec. Andoolo Barat, Kec. Lalembuu,  Kec. Tinanggea dan Selat Tiworo', 'Letak kawasan Kecamatan Tinanggea memiliki batas-batas wilayah yaitu: Kabupaten Bombana, Kec. Andoolo, Kec. Andoolo Barat, Kec. Lalembuu,  Kec. Tinanggea dan Selat Tiworo  <br>\r\n<table border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"492\">\r\n  <tr bgcolor=\"#00CCCC\">\r\n    <td width=\"62\"align=\"center\"><strong>No</strong><strong> </strong></td>\r\n    <td width=\"188\"align=\"center\"><strong>Desa/Kelurahan</strong><strong> </strong></td>\r\n    <td width=\"99\"align=\"center\" nowrap=\"nowrap\"><strong>Luas </strong><strong>(Km<sup>2</sup>)</strong></td>\r\n    <td width=\"133\"align=\"center\" nowrap=\"nowrap\"><strong>Persentase </strong><strong>(%)</strong></td>\r\n  </tr>\r\n  <tr>\r\n    <td width=\"62\" valign=\"top\"align=\"center\">1. </td>\r\n    <td width=\"188\" valign=\"top\">&nbsp;&nbsp;Lanowulu </td>\r\n    <td width=\"99\" valign=\"top\"align=\"right\">11,11&nbsp;&nbsp;</td>\r\n    <td width=\"133\" valign=\"top\"align=\"right\">3,13&nbsp;&nbsp;</td>\r\n  </tr>\r\n  <tr>\r\n    <td width=\"62\" valign=\"top\"align=\"center\">2. </td>\r\n    <td width=\"188\" valign=\"top\">&nbsp;Tatangge </td>\r\n    <td width=\"99\" valign=\"top\"align=\"right\">91,24&nbsp;&nbsp;</td>\r\n    <td width=\"133\" valign=\"top\"align=\"right\">25,72&nbsp;&nbsp;</td>\r\n  </tr>\r\n  <tr>\r\n    <td width=\"62\" valign=\"top\"align=\"center\">3. </td>\r\n    <td width=\"188\" valign=\"top\">&nbsp; Roraya </td>\r\n    <td width=\"99\" valign=\"top\"align=\"right\">33,67&nbsp;&nbsp;</td>\r\n    <td width=\"133\" valign=\"top\"align=\"right\">9,49&nbsp;&nbsp;</td>\r\n  </tr>\r\n  <tr>\r\n    <td width=\"62\" valign=\"top\"align=\"center\">4. </td>\r\n    <td width=\"188\" valign=\"top\">&nbsp; Wundumbolo </td>\r\n    <td width=\"99\" valign=\"top\"align=\"right\"